                        "Name": "五重天の寒雨JP0B",
                        "Desc": "シトラリが夜魂の加護状態にある時、付近にいるチーム内キャラクターが凍結反応、または溶解反応を起こした後、該当反応の影響を受けている敵の<color style='color:#FF9999;'>炎元素</color>と<color style='color:#80C0FF;'>水元素</color>の耐性-20%、継続時間12秒。また、シトラリは夜魂値を16回復する。この方法による夜魂値の回復は、8秒毎に1回のみ可能。JP0B",
                        "Icon": "UI_Talent_S_Citlali_05"
