                        "Desc": "千年以上もの間、謎煙の主で受け継がれてきた密約に従い、白曜シールドを展開し、恐るべき（だと云う）「黒曜ツィツィミメ」イツパパを召喚し、夜魂性質の<color style='color:#99FFFF;'>氷元素範囲ダメージ</color>を与える。<br>白曜シールドのダメージ吸収量はシトラリの元素熟知によって決まり、<color style='color:#99FFFF;'>氷元素ダメージ</color>に対して250%の吸収効果を持つ。さらにシールド生成時、シトラリに短時間の<color style='color:#99FFFF;'>氷元素付着</color>を与える。<br>発動後、シトラリは夜魂値を24獲得し、夜魂の加護状態に入る。<br><br><color style='color:#FFD780;'>夜魂の加護・シトラリ</color><br>イツパパが退場する時、シトラリの夜魂の加護状態は終了する。<br><br><color style='color:#FFD780;'>イツパパ</color><br>・キャラクターと共に行動する。<br>・シトラリの夜魂値が50以上の場合、イツパパは「オパールファイア」状態に入り、持続的に夜魂値を消費する。さらに、キャラクターと共に移動する霜落の嵐を巻き起こし、範囲内の敵を攻撃して夜魂性質の<color style='color:#99FFFF;'>氷元素ダメージ</color>を与える。<br>・夜魂値が尽きると、イツパパの「オパールファイア」状態も終了する。<br><br><i>ふつう、異なる星を象徴する意志は共存できない——純粋な黒が、絶対的な白に映ることなど在りはしないのだから。<br>しかし、シトラリは色に対してこれといったこだわりがなく、故にこのような状況が実現した。</i>JP0B",
