                        "Name": "夜域の賜物・風に舞う鏡と煙",
                        "Desc": "燃素を利用できるナタのエリアにいる時、「夜魂トランス：シトラリ」を行える。フィールド上キャラクターが一定の高さの空中にいる時、シトラリに切り替えると、シトラリは高く跳躍し、「白曜ツィツィミメ・シトラリン」の力を借りて宙に浮く。自身のチームにおいて、夜魂トランスは10秒毎に1回のみ発動可能。<br><br>長押しで狙いを定めると、シトラリは「霊覚」状態に入る。この状態にある時、シトラリは「謎霊のラクガキ」と「謎霊のシジル」から情報や力を引き出せる。それらのオブジェクトのインタラクトルールはイクトミ竜のインタラクトルールに従う。<br><br>さらに、ジャンプを長押しすると、シトラリはスタミナを75消費して跳び上がる。燃素を利用できるナタのエリアにいる時、シトラリは燃素を5消費して、より高く跳躍する。なお、スタミナよりも燃素の消費が優先される。<br>空中にいる時、シトラリは通常攻撃ボタンを長押しすることで、燃素またはスタミナを消費して照準と重撃を行える。空中で重撃を行う時、シトラリは20の燃素を優先的に消費する。",
